DROP TABLE IF EXISTS Fall2024;
DROP TABLE IF EXISTS Winter2025;

CREATE TABLE Fall2024 (fall_id INTEGER PRIMARY KEY AUTO_INCREMENT, crn INTEGER, section VARCHAR(255), title TEXT, course_code VARCHAR(255), instructor VARCHAR(255), start_time TIME, end_time TIME, days VARCHAR(255));
CREATE TABLE Winter2025 (winter_id INTEGER PRIMARY KEY AUTO_INCREMENT, crn INTEGER, section VARCHAR(255), title TEXT, course_code VARCHAR(255), instructor VARCHAR(255), start_time TIME, end_time TIME, days VARCHAR(255));

